import React from 'react';
import '../styles/Gallery.css';

const Gallery: React.FC = () => {
  const galleryItems = [
    {
        src: '/images/southkorea.jpg',
        title: 'South Korea',
        description: "I love South Korea and its' culture. From the food to the fashion to the people, it is truly a beautiful place",
    },
    {
        src: '/images/japan.jpg',
        title: 'Japan',
        description: "",
    },
    {
        src: '/images/china.jpg',
        title: 'China',
        description: "",
    },
    {
        src: '/images/vietnam.jpg',
        title: 'Vietnam',
        description: "",
    },
    {
        src: '/images/singapore.jpg',
        title: 'Singapore',
        description: "",
    },
  ];

return (
    <section id="gallery" className="gallery-section">
      <h2>Gallery</h2>
      <div className="gallery-grid">
        {galleryItems.map((item, index) => (
          <div key={index} className="gallery-item">
            <img src={item.src} alt={item.title} className="gallery-image" />
            <h3 className="gallery-title">{item.title}</h3>
            <p className="gallery-description">{item.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Gallery;
